import "./css/App.css";
import Header from "./components/Header";
import Gallery from "./components/Gallery";
import Navigation from "./components/Navigation";
import Home from "./components/Home";
import { Route, HashRouter, Switch } from "react-router-dom";

function App() {
  const links = [
    {
      link: "/",
      name: "Home",
      component: <Home />,
    },
    {
      link: "/gallery",
      name: "Mars Rover",
      component: <Gallery />,
    },
    {
      link: "/gallery",
      name: "APOD",
      component: <Gallery />,
    },
  ];

  return (
    <div className="App">
      <Header />
      <HashRouter>
        <Navigation links={links} />
        <Switch>
          {links.map((obj, index) => {
            return (
              <Route key={index} path={obj.link}>
                {obj.component}
              </Route>
            );
          })}
        </Switch>
      </HashRouter>
    </div>
  );
}

export default App;
